import UserData from '../../UserData/UserData';

import Wrapper from '../UI/Wrapper/Wrapper';
import classes from './Cars.module.css';

const Cars = (props) => {
  return (
    <Wrapper>
      <div className="cars-list">
        <ul>
          <li>BMW E46 320D</li>
          <li>BMW E30 316i</li>
        </ul>
      </div>
      
    </Wrapper>
  );
};

export default Cars;
